import React, { useEffect, useState } from 'react';
import styles from '../css/test.module.css'
import img1 from '../images/img1.avif'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlay } from '@fortawesome/free-solid-svg-icons';
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import { faThumbsUp } from '@fortawesome/free-solid-svg-icons';
import { faAngleDown } from '@fortawesome/free-solid-svg-icons';
import { faCheck } from '@fortawesome/free-solid-svg-icons';


const Testfunction = () => {
    const [isHovered, setIsHovered] = useState(false);
    const [checkicon, ischeckiconvisible] = useState("")
    const video = "https://d15gpg7sfwrx94.cloudfront.net/videos/payal%20latest%20vlog.mp4"



    return (<>
        <div
            onMouseEnter={() => setIsHovered(true)}
            onMouseLeave={() => setIsHovered(false)}
        >
            {isHovered ?
                <div className={styles.card1}>
                    <div className={styles.imgwrap}>
                        <video src={video}
                            autoPlay muted loop
                            width="100%" height="100%"
                            onMouseLeave={() => setIsHovered(false)} />
                    </div>
                    <ul>
                        <li><FontAwesomeIcon icon={faPlay} size={50} /></li>
                    </ul>

                    {checkicon ? <FontAwesomeIcon icon={faPlus} onClick={() => { ischeckiconvisible(true) }} />

                        :
                        <FontAwesomeIcon icon={faCheck} />}
                    <FontAwesomeIcon icon={faThumbsUp} />
                    <FontAwesomeIcon icon={faAngleDown} />
                </div>
                :
                <div className={styles.card1}>
                    <div className={styles.imgwrap}>
                        <img src={img1} width="100%" height="100%" />
                    </div>
                </div>

            }
        </div>
    </>)
}

export default Testfunction;
